import react from 'react';
import axios from 'axios';


const Profile = (props) =>{
    const firstName = props.data.firstName;
    const lastName = props.data.lastName;

    console.log(props.data);


    return(
        <div>
            <h1>Profile</h1>
            <p>
                FirstName: {firstName}
                LastName: {lastName}
            </p>
        </div>
    )
}

export default Profile;
